import React from 'react'
import style from './playerInfo.module.css'


const PlayerInfo = ({ first, last, position, heightF, heightI, team }) => {
    return (
        <div>
            <h2 className={style.playername}>{first} {last}</h2>
            <p className={style.playerinfo}>Position: {position} | Height: {heightF}"{heightI} | Team: {team}</p>
        </div>
    )
}

export default PlayerInfo
